import React, { Component } from "react";
import Table from "react-bootstrap/Table";
import mssql from "../images/language-logos/mssql.png";
import mysql from "../images/language-logos/mysql.png";

class Skills extends Component {
  state = {};
  render() {
    return (
      <div className="skills-container">
        <div className="skills">
          <div className="skills-title">Operating Systems</div>
          <Table className="skills-table">
            <tbody>
              <tr>
                <td className="skills-image no-padding">
                  <img src={mssql} alt="Microsft SQL" />
                </td>
                <td className="skills-text">Microsoft SQL</td>
              </tr>
              <tr>
                <td className="skills-image">
                  <img src={mysql} alt="MySQL" />
                </td>
                <td className="skills-text">MySQL</td>
              </tr>
            </tbody>
          </Table>
        </div>
      </div>
    );
  }
}

export default Skills;
